const indexStyles = {
  addMenuOpen: {
    width: "300px",
    height: "300px",
    visibility: "visible",
    backgroundColor: "#C1C1C1"
  },
  addMenuHidden: {
    width: "300px",
    height: "300px",
    visibility: "hidden",
    backgroundColor: "#C1C1C1"
  }
};

export default indexStyles;
